measurements.description:
One flower and one bud on one 9-cm inflorescence;  
   dorsal sepal ivory, heavily veined and suffused maroon, small proximal area bright green centrally, green veins distal tip; 
   synsepal pale green, maroon veins;
   petals heavily spotted dark maroon, bright green basally transitioning to maroon, distal third intense maroon;
   pouch dark burgundy; 

	substance firm; texture glossy.
